contracts/ArtixMemeContest.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";


// Main Meme Contest Contract
contract ArtifactMemeContest is Initializable, OwnableUpgradeable, ReentrancyGuardUpgradeable {
    using Counters for Counters.Counter;

    // Meme Submission Structure
    struct MemeSubmission {
        uint256 id;
        address creator;
        string ipfsHash;
        string title;
        string description;
        string socialLinks;
        uint256 networkId;
        uint256 voteCount;
        uint256 submissionTime;
        bool isActive;
        bool hasBeenMinted;
    }

    // Voting Configurations
    struct VotingConfig {
        uint256 maxVotes;
        uint256 contestDuration;
        uint256 minVotesForWin;
        uint256 voteCost;
    }

    // State Variables
    Counters.Counter private _memeIds;
    mapping(uint256 => MemeSubmission) public memes;
    mapping(uint256 => mapping(address => bool)) public hasVoted;
    mapping(address => uint256[]) public userVotedMemes;

    VotingConfig public votingConfiguration;

    // Events for Transparency
    event MemeSubmitted(
        uint256 indexed memeId, 
        address indexed creator, 
        string ipfsHash, 
        string title, 
        uint256 networkId
    );
    event VoteCast(
        uint256 indexed memeId, 
        address indexed voter, 
        uint256 votingPower
    );
    event MemeWinner(
        uint256 indexed memeId, 
        address indexed creator, 
        uint256 voteCount
    );

    // Initializer (replaces constructor for upgradeable contracts)
    function initialize(
        uint256 _maxVotes, 
        uint256 _contestDuration, 
        uint256 _minVotesForWin,
        uint256 _voteCost
    ) public initializer {
        __Ownable_init(msg.sender);
        __ReentrancyGuard_init();

        // Set initial voting configurations
        votingConfiguration = VotingConfig({
            maxVotes: _maxVotes,
            contestDuration: _contestDuration,
            minVotesForWin: _minVotesForWin,
            voteCost: _voteCost
        });
    }

    // Meme Submission Function
    function submitMeme(
        string memory ipfsHash,
        string memory title,
        string memory description,
        string memory socialLinks,
        uint256 networkId
    ) external payable nonReentrant {
        // Validate submission
        require(bytes(ipfsHash).length > 0, "Invalid IPFS hash");
        require(bytes(title).length > 0, "Title required");

        _memeIds.increment();
        uint256 newMemeId = _memeIds.current();

        // Create Meme Submission
        memes[newMemeId] = MemeSubmission({
            id: newMemeId,
            creator: msg.sender,
            ipfsHash: ipfsHash,
            title: title,
            description: description,
            socialLinks: socialLinks,
            networkId: networkId,
            voteCount: 0,
            submissionTime: block.timestamp,
            isActive: true,
            hasBeenMinted: false
        });

        emit MemeSubmitted(newMemeId, msg.sender, ipfsHash, title, networkId);
    }

    // Voting Mechanism
    function voteMeme(uint256 memeId) external payable nonReentrant {
        MemeSubmission storage meme = memes[memeId];

        // Voting Validations
        require(meme.isActive, "Meme is not active");
        require(!hasVoted[memeId][msg.sender], "Already voted");
        require(msg.value >= votingConfiguration.voteCost, "Insufficient vote cost");

        // Cast Vote
        meme.voteCount++;
        hasVoted[memeId][msg.sender] = true;
        userVotedMemes[msg.sender].push(memeId);

        emit VoteCast(memeId, msg.sender, 1);

        // Check for Winner
        if (meme.voteCount >= votingConfiguration.maxVotes) {
            meme.isActive = false;
            emit MemeWinner(memeId, meme.creator, meme.voteCount);
        }
    }

    // Admin Functions
    function updateVotingConfiguration(
        uint256 _maxVotes, 
        uint256 _contestDuration, 
        uint256 _minVotesForWin,
        uint256 _voteCost
    ) external onlyOwner {
        votingConfiguration.maxVotes = _maxVotes;
        votingConfiguration.contestDuration = _contestDuration;
        votingConfiguration.minVotesForWin = _minVotesForWin;
        votingConfiguration.voteCost = _voteCost;
    }
}

contracts/ArtixNFT.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";


// NFT Minting Contract
contract ArtifactNFT is ERC721URIStorage {
    constructor() ERC721("ArtifactNFT", "ANFT") {
    }

    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    // Supported Networks
    enum Network {
        Ethereum,
        Polygon,
        Solana,
        Base
    }

    // NFT Minting Event
    event NFTMinted(
        uint256 indexed tokenId, 
        address indexed creator, 
        string tokenURI, 
        Network network
    );

    // Mint NFT Function
    function mintMemeNFT(
        address creator, 
        string memory tokenURI, 
        Network network
    ) external returns (uint256) {
        _tokenIds.increment();
        uint256 newTokenId = _tokenIds.current();

        // Mint NFT
        _mint(creator, newTokenId);
        _setTokenURI(newTokenId, tokenURI);

        emit NFTMinted(newTokenId, creator, tokenURI, network);
        return newTokenId;
    }
}

contracts/ArtixRanking.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts-upgradeable/proxy/utils/Initializable.sol";
import "@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "@openzeppelin/contracts-upgradeable/utils/ReentrancyGuardUpgradeable.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";


// User Ranking Contract
contract ArtifactRanking is Initializable, OwnableUpgradeable {
    // Ranking Levels
    enum RankLevel {
        Newcomer,
        Bronze,
        Silver,
        Gold,
        Platinum
    }

    // User Ranking Structure
    struct UserRanking {
        uint256 totalVotes;
        uint256 totalMemeSubmissions;
        RankLevel currentRank;
        uint256 points;
    }

    // State Variables
    mapping(address => UserRanking) public userRankings;
    mapping(RankLevel => uint256) public rankThresholds;

    // Events
    event RankUpdated(
        address indexed user, 
        RankLevel previousRank, 
        RankLevel newRank
    );

    // Initializer
    function initialize() public initializer {
        __Ownable_init(msg.sender);

        // Set Initial Rank Thresholds
        rankThresholds[RankLevel.Newcomer] = 0;
        rankThresholds[RankLevel.Bronze] = 50;
        rankThresholds[RankLevel.Silver] = 200;
        rankThresholds[RankLevel.Gold] = 500;
        rankThresholds[RankLevel.Platinum] = 1000;
    }

    // Update User Ranking
    function updateRanking(
        address user, 
        uint256 votesEarned, 
        bool isMemeSubmission
    ) external {
        UserRanking storage ranking = userRankings[user];

        // Update Vote and Submission Counts
        ranking.totalVotes += votesEarned;
        if (isMemeSubmission) {
            ranking.totalMemeSubmissions++;
        }

        // Calculate Points
        ranking.points = calculatePoints(ranking);

        // Determine New Rank
        RankLevel previousRank = ranking.currentRank;
        ranking.currentRank = calculateRankLevel(ranking.totalVotes);

        // Emit Rank Change Event
        if (previousRank != ranking.currentRank) {
            emit RankUpdated(user, previousRank, ranking.currentRank);
        }
    }

    // Point Calculation Logic
    function calculatePoints(UserRanking memory ranking) internal pure returns (uint256) {
        return 
            (ranking.totalVotes * 10) + 
            (ranking.totalMemeSubmissions * 50);
    }

    // Rank Determination
    function calculateRankLevel(uint256 totalVotes) public view returns (RankLevel) {
        if (totalVotes >= rankThresholds[RankLevel.Platinum]) return RankLevel.Platinum;
        if (totalVotes >= rankThresholds[RankLevel.Gold]) return RankLevel.Gold;
        if (totalVotes >= rankThresholds[RankLevel.Silver]) return RankLevel.Silver;
        if (totalVotes >= rankThresholds[RankLevel.Bronze]) return RankLevel.Bronze;
        return RankLevel.Newcomer;
    }
}

